  "descripcion_general": "La Asociación Claver es una organización sin ánimo de lucro promovida por el Centro Arrupe y la Comunidad de Vida Cristiana en Sevilla (CVX), surge en el año 2000 y su ámbito de actuación es andaluz. La Asociación Claver forma parte\ndel Apostolado Social, pertenece al Servicio Jesuita a Migrantes (SJM) España, red de entidades que trabaja por la defensa de los derechos de las personas migrantes y su pleno acceso a la ciudadanía.\n\n\nPrestan servicios de asesoramiento y formación sociolaboral; así como acompañamiento en procesos de empoderamiento personal y participación de mujeres migradas, muchas de ellas trabajadoras del hogar.\nAsesoría, información y formación jurídica en extranjería y derecho laborales.\nAcompañamiento en procesos de fortalecimiento del tejido asociativo migrante, prestando asesoramiento y servicios formativos; así como participando de un esfuerzo común con otras organizaciones andaluzas en diversas plataformas del ámbito de las migraciones.\nPromueven una cultura de la hospitalidad y la inclusión, promoviendo espacios de encuentro, acogida y amistad a través de pisos de acogida de mujeres (y sus hijos) en Sevilla, Córdoba y Granada; y colaborando con otras comunidades de hospitalidad como la Red de familias acogedoras y Mambré en Sevilla.\nParticipan en la observación del grado de respeto y vulneración de los Derechos Humanos de las personas migrantes en las fronteras exteriores (trabajando con el equipo SJM-Frontera Sur, que tiene oficina en Melilla, así como con la Delegación Diocesana de Migraciones en Nador) y en fronteras interiores como los CIE (visitando a internos en el CIE de Algeciras) o en los asentamientos agrícolas (contacto con la misión de la Compañía de Jesús en Almería).\nIncidencia pública para promover marcos legales, políticas y prácticas garantes y respetuosas de los derechos humanos de las personas migrantes mediante publicaciones y participando en iniciativas como las plataformas Somos Migrant